css:
@-moz-document domain("okoun.cz") {
:root {
    --color0: #e8e1cf; /* #5c8799; d85f46;*/ /* hlavicka a tlacitko Prispet*/
    --color1: #00af89; /* pruh noveho prispevku a oznameni */
    --color2: hsl(214, 11%, 75%); /* mezery mezi prispevky a pozadi strankovani */
    --color3: #6f504e; /* barva hornich odkazu */
}
/* reklamy */
#adwrapper-lb, #adwrapper-bs, .share {
    display:none!important;
}

body, .content {
    padding: 0;
    background-color: var(--color0);
    font-size: 20pt;
    line-height: 1.2;
    font-family: IBMPlexSans, Helvetica Neue, Segoe UI, Helvetica, Verdana, Arial, sans-serif;
}

#body {
    margin: 0;
    padding: 0;
    background-color: #fff;
}
.content {
    background-color: #fff;
}
.content * {
    font-family: IBMPlexSans, Helvetica Neue, Segoe UI, Helvetica, Verdana, Arial, sans-serif;
}
a, a:hover {
    color: blue;
}

/* hlavicka */
.head {
    margin: 0;
    padding: 1em 1em 0 1em;
    background-color: var(--color0);
    border: none;
}
.menu a, .head .user a {
    color: var(--color3)!important;
}
.menu a:hover, .head .user a:hover {
    color: var(--color3)!important;
    background-color: #fff;
}
/* head search */
.menu .search {
    width: 100%;
}

/* logo */
.head h1 {
    height:auto;
    font-family: inherit;
}
.head h1 a {
    background-image: var(--logo);
    background-position: 0 0;
    color: var(--color3);
    font-size: 1.5em;
    padding-bottom: 44px;
}
.head h1 a:hover {
    background-position: 0 0;
}

/* hlavni menu */
.head .nav {
    width: 100%;
}
.head .menu {
    margin-left: 0px;
}
.head .menu form {
    margin-bottom: 0.5em;
}
.head .menu span, .item .actions a {
    margin-right: 0.4em;
}
.head .menu, .board .main .settings {
    font-size: 100%;
}
.head > .nav > .menu > span > a, .head > .nav > .menu > a, .head > .nav > .menu > .search > a {
    text-decoration: underline;
}
.head > .nav > .menu > .search > .yui-button.yui-submit-button > .first-child > button.submit {
    color: var(--color3);
}
.head > .user > .login > .yui-button.yui-submit-button > .first-child > button.submit {
    color: var(--color3);
}

.user > b {
    font-weight: normal;
    line-height: 3;
}
.head > .user > img {
    display:none;
}

/* oznameni */
#sysmsgBox.messages, .sysmsgBox.messages, #errorBox.messages, .errorsBox.messages {
    border:none;
}
.messages .content {
    background-color: var(--color1);
    padding: 1rem 1em;
    color: #fff;
}
.messages {
    margin-bottom: 0;
}

/* sidebar */
.main .ctx {
    padding: .7em 0;
    color: #37393a;
    font-size: 0.8em;
    position:absolute;
    width: 100%;
    background-color: var(--color2);
    font-weight: 300;
}
h3 {
    padding-left: 1em;
    color: #37393a;
    font-weight: 300;
}
.yui-u.ctx > .ico-wrapper, .yui-u.ctx > p {
    display: none;
}
.yui-u.ctx > p > br {
    display:none;
}

/* hlavni sloupec */
.main .main {
    width: 100%;
    top: 85px;
}

/* dlouhe odkazy */
.nobr {
    white-space: normal;
}
a {
    overflow-wrap: break-word;
}

h2, .ctx h3, .index h3, .expbutton .hd, .ad .label {
    font-family: inherit;
    border: none;
}

/* nazev klubu */
.yui-ge div.first, .yui-gf .yui-u {
    width: 100%;
    background-color: #fff;
}
.yui-u.first > h2 {
    margin-left: 75px;
    margin-bottom: .7em;
}
.yui-u.first >  h2 > a {
    color: #000;
    font-weight: 600;
}
/* hvezdicka */
.board .main .bmk {
    top: 4px;
    left: 5px;
}
.board .bmk, .board .bmk a, .board .bmk a input {
    width: 50px;
    height: 50px;
}
.board .bmk a {
    background-image: var(--staricon);
}
.board .bmk a.on, .board .bmk a.on:hover {
    background-position: 0px -50px;
}
.board .bmk a.off:hover {
    background-position: 0px 0px;
}
/* rozbalovaci ikonka zahlavi */
.expcol.ico[name="markWelcomeMsgBoardForm"] {
    top: 95px;
    left: 1em;
    height: 55px;
    width: 82px;
}
.expcol .ico {
    background-image: var(--rollicon);
}
/* zavrene zahlavi*/
.col .ico {
    background-position: 0 0;
}
/* rozbalene zahlavi */
.exp .ico {
    background-position: 0 -54px;
}
/* zbytecna rozbalovaci ikonka noveho prispevku */
.hd > .expcol > .ico {
    display:none;
}

/* zahlavi */
.welcome {
    border: none;
    padding:10px;
    margin: 0.5em 1em 1.2em 1em;
    border-radius: 2px;
    box-shadow: 0 1px 4px rgba(0, 0, 0, .6);
}
.welcome > .content {
    text-indent: 80px;
}
.info span.loading {
    display: none!important;
}

/* tlacitko Prispet */
.hd {
    margin: 0 0 1em 1em;
    background-color: #fff;
    border-radius: 2px;
    color: var(--color0);
    padding: 8px 20px;
}
.expbutton .hd {
    background-color: var(--color0);;
}
.expbutton .hd a {
    color: var(--color3);
}

.hd > a.expcol {
    font-weight: 700;
    letter-spacing: .1em;
    text-transform: uppercase;
}

/* novy prispevek formular */
.post.content form, .post.content .form {
    padding: 0;
}
.item .actions.replyForm a.reply, .expbutton .post.content, .actions.replyForm .post.content {
    background-color: #9ba3ae;
    border: 0;
}
.post.content textarea, .post.content input.text {
    margin: 0.5em 0;
}
textarea, input.text.long {
    padding: 0;
    width: 98%;
    border: none;
}
#post-body, .text.title.long.prompt {
    display: block;
    margin-left: auto;
    margin-right: auto;
}
.content p, .content fieldset, .content table {
    margin: 0;
}
.post.content .tools {
    margin: 0.5em 3em 0;
    padding-bottom: 1em;
}

/* search bars */
.col .search {
    padding-top: 0.3em;
    width: 65%;
}
.board .main .search input.text, .search input.text, .board .main .search input.text.authors {
    border-radius: 4px;
    background-color: #f0f0f0;
    width: 8em;
    height: 1.7em;
    padding-left: 10px;
    font-size: 100%;
}
/* search button */
.yui-skin-sam .yui-button, .yui-skin-sam .yui-button .first-child {
    border:none;
    background: none;
    margin: 0;
}
.yui-button button {
    font-weight: 700;
    letter-spacing: .1em;
    text-transform: uppercase;
    background-color: #fff0;
    opacity: .5;
}
select, input, button, textarea {
    font: inherit;
}

.boardlist h3 {
    font-size: 100%;
}

.articles {
    border: none;
}
.content, .item .meta, body.userlist .main .main, body.boardlist .main .main {
    font-size: 100%;
}
.item .meta .user {
    font-size: .8em;
    font-weight: 400;
    line-height: 1em;
    color: #9ca3b3;
    padding-left: 40px;
}
.item .meta {
    margin: 0 0 .3em;
}

/* popisek vedle jmena */
.descr, .hpdescr {
    display: none;
}

.room .item {
    border-bottom: 10px solid hsla(214, 8%, 68%, .38); /* #dde0e4; */
}

/* detaily prispevku */
.item .content, .item .title {
    padding: 0 40px;
    margin: 0;
}
.item .actions {
    margin: 0;
    border: none;
    padding: 1.6em 0;
    padding-left: 40px;
}
.item .meta .delete, .item .actions {
    font-size: .8em;
    font-weight: 400;
    line-height: 1em;
    color: #9ca3b3;
}
.item .actions .reply, .item .actions .remove, .item .actions.replyForm .post {
    padding-left: 0;
}
.item .actions a, .item .actions span.prev a.prev {
    margin: 0;
    padding: 0;
}
.anon {
    font-weight: 400;
}
.item.hover .actions a {
    color: #9ca3b3;
}
.listing .item {
    padding-top: .8em;
    padding-bottom: 0;
}

/* datum prispevku */
.item .meta .permalink {
    bottom: 1em;
}
.item .meta .descr, .item .meta .hpdescr, .item .meta .permalink {
    font-size: .8em;
}
.item .date, .item .permalink a, .item .meta a {
    color: #9ca3b3;
}
.item a.link {
    background-image: none;
}

/* reply icon */
.item .actions a, .item .actions span.prev a.prev {
    background: none;
}
.item .actions .reply, .item .actions .remove, .item .actions.replyForm .post {
    margin: 0;
}

/* avatary */
.user.ico, .user .ico {
    display: none;
    border: none;
    box-shadow: 0 1px 4px rgba(0, 0, 0, .6);
}
.item .ico {
    margin-top: 0;
}

/* odsazeni prispevku od zbytku */
.list-and-pagers-wrapper {
    margin-top: 2.5em;
}

/* novy prispevek */
/* barevna lista */
.room .item.new.o-first {
    border-top: none;
}
.room .item.new {
    border-right: none;
    border-left: 25px solid var(--color1);
    border-bottom: 10px solid var(--color2);
}
.item.new .user, .item.new .content, .item.new .actions {
    padding-left: 15px;
}
.item.new .actions {
    border: none;
}

/* nahled */
.preview {
    background-color: #fff;
    border: 1px solid #000;
    border-radius: 4px;
}
.post.content .preview {
    margin: 1em;
}
.preview .item {
    background-color: #fff;
}
.ad .label, .preview .label {
    color: #fff;
    background-color: #000;
    border: none;
    border-radius: 0 0 4px 4px;
    font-size: 100%;
    padding: 0px 20px;
    margin: 0 42.5%;
}
.preview .reset-f {
    font-size: 1em;
}
.preview .item {
    border-bottom: none;
}

/* odpoved */
.item .actions.replyForm .post {
    padding: 0 10px;
    font-size: 100%;
    box-sizing: border-box;
}
.actions.replyForm .post.content .form .tools .yui-button.preview {
    margin: 0;
}
.yui-skin-sam .yui-button button {
    font-size: 100%;
}

/* pagination */
.pager-top {
    right: 0;
    background-color: var(--color2);
}
.pager {
    overflow-x: scroll;
    overflow-y: hidden;
    display: flex;
    margin-top: 0;
    margin-bottom: -.5em;
    padding-top: .7em;
}
.pager ul{
    font-size: 1em;
    margin: 0;
    white-space: nowrap!important;
}

/* strany skokove */
.pager ul li.newest, .pager ul li.newer, .pager ul li.older, .pager ul li.oldest {
    background: none;
    padding: 0;
}
.pager ul li.newest a, .pager ul li.newer a, .pager ul li.older a, .pager ul li.oldest a {
    padding: 20px;
    display: inline-block;
}
.pager ul li.newest a:hover, .pager ul li.newer a:hover, .pager ul li.older a:hover, .pager ul li.oldest a:hover {
    color: rgb(0, 0, 0)!important;
    background-color: #fff;
}
li.newest, li.newer, li.older, li.oldest {
    color: #0000004a;
    text-transform: lowercase;
    font-weight: 300;
}
.pager > .nav:first-child {
    margin-right: 8px;
}
.pager > .nav:nth-child(3n) {
    margin-left: 8px;
}

/* strany ciselne */
.pager ul li {
    background: none;
    display: inline-block;
}
.pager ul li a {
    background-color: #f8f9fac7;
    padding: 19px 42px;
    color: rgb(45, 46, 47);
    border-radius: 2px;
    font-weight: 300;
    text-decoration: none;
}
.pager ul li a:hover {
    background-color: #fff; 
    color: rgb(45, 46, 47)!important;
}
.pager ul li.curr {
    background-color: #fff;
    color: rgb(45, 46, 47);
    border:none;
    border-radius: 2px;
    padding: 20px 44px;
    font-weight: 700;
}

/* pagination bottom */
div.listing.thin > form > div.pager {
    margin-bottom: -50px;
}

/* footer */
.footer {
    text-align: left;
    background-color: var(--color2);
    border: none;
    padding: 160px 1rem 1.5em;
    margin: 0;
}
.footer a{
    color: #ffffffe8;
    font-weight: 300;
}
}

@-moz-document url("https://www.okoun.cz/") {
.yui-gc div.first {
    width: 100%;
}
.yui-gb .yui-u, .yui-g .yui-gb .yui-u, .yui-gb .yui-g, .yui-gb .yui-gb, .yui-gb .yui-gc, .yui-gb .yui-gd, .yui-gb .yui-ge, .yui-gb .yui-gf, .yui-gc .yui-u, .yui-gc .yui-g, .yui-gd .yui-u {
    width:100%;
}
}

@-moz-document domain("okoun.cz") {
:root {
    --staricon:url('data:image/png;base64,');
    --rollicon:url('data:image/png;base64,');
    --logo:url('data:image/png;base64,');
}
}
